import React from 'react';
import ReactDOM from 'react-dom';
import { createBrowserHistory } from 'history';
import {
    Router,
    Route,
    Switch
} from 'react-router-dom';

import 'bootstrap/dist/css/bootstrap.css';
/*import 'font-awesome/css/font-awesome.min.css';*/
import 'assets/scss/zest-admin.css';
import 'assets/fonts/simple-line-icons.css';

import indexRoutes from 'routes/index.jsx';

import PublicRoute from './routes/PublicRoute.jsx';
import PrivateRoute from './routes/PrivateRoute.jsx';

const hist = createBrowserHistory();

ReactDOM.render(

    <Router>
    <Switch>
        <PublicRoute exact path="/login">
        </PublicRoute>
        <PublicRoute exact path="/register">
        </PublicRoute>
        <PublicRoute exact path="/forgot-password">
        </PublicRoute>
        <PublicRoute exact path="/recover-password">
            <RecoverPassword />
        </PublicRoute>
        <PublicRoute exact path="/privacy-policy">
            <PrivacyPolicy />
        </PublicRoute>
        <PublicRoute exact path="/callback">
            <h1>Callback</h1>
        </PublicRoute>
        <PrivateRoute path="/">
            <Main />
        </PrivateRoute>
    </Switch>
</Router>

, document.getElementById('root'));
